    <div className="nav">
      导航
      <div>
        <Link href="/block">
          <a>Homek</a>
        </Link>
        <Link href="/block">
          <a>Blocks</a>
        </Link>
        <Link href="/block">
          <a>Transactions</a>
        </Link>
      </div>
    </div>
  );
}
